import React, { useEffect, useState} from 'react';
import Navbar from "./components/navbar"
import Footer from "./components/footer"
import 'bulma/css/bulma.css'

function App() {

  const [response, setResponse] = useState({ apiResponse: "" });

  // function callAPI() {
  // };

  // eslint-disable-next-line react-hooks/exhaustive-deps
  function callAPI() {
    const response =  fetch("http://localhost:9000/testAPI")
    const data =  response.json();  // convert to json
    const [item] = data.results;
    console.log(item)
      setResponse({ apiResponse: item })
    console.log('I was triggered during useEffect')
  }

  useEffect(() => {
    callAPI();
  })

  return (
    <div className="App">
      <Navbar />       
      <p>[{response}]</p>
      <Footer/>
    </div>
  );
}

export default App;
